<script>
import AppLayout from "@/Layouts/AppLayout";
import JetButton from "@/Jetstream/Button";
import JetInput from "@/Jetstream/InputDisable";
import JetLabel from "@/Jetstream/Label";
import JetModal from "@/Jetstream/Modal";
import JetPagination from "@/Jetstream/Pagination";
import jsPDF from "jspdf";
import "jspdf-autotable";

export default {
  components: {
    AppLayout,
    JetButton,
    JetInput,
    JetLabel,
    JetModal,
    JetPagination,
    jsPDF,
  },
  props: {
    ingresos: Array,
    proveedores: Array,
    usuario: Array,
  },

  data() {
    return {
      
      dato: {},
    };
  },
  methods: {
    printInvoice() {
      var head = [
        [
          "ID",
          "NOMBRE",
          "CANTIDAD",
          "U. MEDIDA",
          "PRECIO (Incl. Igv)",
          "MONTO (Incl. Igv)",
        ],
      ];

      this.dato = this.ingresos.productos.map((elemento) => [
        elemento.id,
        elemento.Nombre,
        elemento.pivot.cantidad,
        elemento.UnidadMedida,
        elemento.pivot.precio,
        elemento.pivot.monto,
      ]);

      var doc = new jsPDF("p", "pt");
      var imgData =
        "data:image/jpeg;base64,";

      doc.addImage(imgData, "JPG", 30, 30, 250, 100);

      doc
        .setFont("times")
        .setFontSize(20)
        .text(420, 40, "INGRESO N°: " + this.ingresos.id);
      doc.setFont("times").setFontSize(11).text(416, 70, "Fecha:");
      doc.setFont("times").setFontSize(11).text(490, 70, this.ingresos.Fecha);
      doc.setFont("times").setFontSize(11).text(385, 85, "Comprobante:");
      doc
        .setFont("times")
        .setFontSize(11)
        .text(490, 85, this.ingresos.TipoComprobante);
      doc.setFont("times").setFontSize(11).text(419, 100, "Serie:");
      doc
        .setFont("times")
        .setFontSize(11)
        .text(490, 100, this.ingresos.SerieComprobante);
      doc.setFont("times").setFontSize(11).text(407, 115, "Numero:");
      doc
        .setFont("times")
        .setFontSize(11)
        .text(490, 115, this.ingresos.NumeroComprobante);
      doc.setFont("times").setFontSize(10);

      doc
        .setFont("times")
        .setTextColor("#7C3AED")
        .setFontSize(11)
        .text(50, 180, "PROVEEDOR:");
      doc
        .setFont("times")
        .setTextColor("#F87171")
        .setFontSize(11)
        .text(380, 180, "RECEPCIONISTA:");
      doc
        .setFont("times")
        .setTextColor("#000000")
        .setFontSize(15)
        .text(50, 195, this.proveedores.Nombres);
      doc.setFont("times").setFontSize(15).text(380, 195, this.usuario.name);
      doc
        .setFont("times")
        .setTextColor("#7C3AED")
        .setFontSize(11)
        .text(50, 210, "DNI/RUC:");
      doc
        .setFont("times")
        .setFontSize(11)
        .setTextColor("#F87171")
        .text(380, 210, "DNI:");
      doc
        .setFont("times")
        .setFontSize(10)
        .setTextColor("#000000")
        .text(50, 225, this.proveedores.NumeroDocumento + "");
      doc
        .setFont("times")

        .setFontSize(10)
        .text(380, 225, this.usuario.NumeroDocumento + "");

      doc.autoTable({
        head: head,
        body: this.dato,
        margin: { top: 270 },
        headStyles: {
          fillColor: "#7C3AED",
          textColor: "#ffffff",
          halign: "center",
        },
        bodyStyles: {
          halign: "center",
        },
      });
      doc.setFont("times").setFontSize(10).text("TOTAL INC IGV:", 366, 590);

      doc
        .setFont("times")
        .setFontSize(12)
        .text(490, 590, this.ingresos.Total + "");

      doc
        .setFont("times")
        .setFontSize(10)
        .text("IGV (18%) INCL. TOTAL:", 330, 615);
      doc
        .setFont("times")
        .setFontSize(12)
        .text(490, 615, this.ingresos.Impuesto + "");

      doc.setLineWidth(0.5);
       doc.setDrawColor("#7C3AED")
      doc.line(300, 625, 550, 625);

      doc.setFont("times").setFontSize(10).text("MONTO TOTAL:", 368, 645);
      doc
        .setFont("times")
        .setFontSize(12)
        .text(490, 645, this.ingresos.Total + "");
      doc.setLineWidth(0.5);
       doc.setDrawColor("#7C3AED")
      doc.line(300, 655, 550, 655);

      var pageCount = doc.internal.getNumberOfPages();

      for (var i = 1; i <= pageCount; i++) {
        doc.setPage(i);
        doc
          .setFont("times")
          .setFontSize(11)
          .text(
            "Página " + String(i) + " de " + String(pageCount),
            40,
            doc.internal.pageSize.height - 30
          );
      }

      doc.save("Ingreso.pdf");
    },
  },
};
</script>

